webpackJsonp([0xa7108fb8ee6d],{5109:function(t,e){t.exports={data:{post:{html:'<p>Today we took Christopher swimming for the first time. Mama\'s sister-in-law recommended the indoor pool in Schneverdingen, that has a wading pool set aside for parents and babies. It\'s also closer and cheaper than the pools in Hamburg.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/07/2000071610.jpg" height="262" width="350" border="0" alt="crhpool2.jpg: " /></p>\n<p>We were pretty tired afterwards.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/07/2000071613.jpg" height="262" width="350" border="0" alt="crhpool3.jpg: " /></p>\n<p>In fact, this afternoon both wife and child are sound asleep. Mama claimed that I was snoring too loud for her to sleep well last night, but I didn\'t hear a thing!</p>',fields:{title:"Baby Swim",date:"16 Jul 2000",url:"https://papascott.de/2000-07-16-baby-swim/"}}},pathContext:{slug:"/2000-07-16-baby-swim/",prev:{fields:{title:"House Warming",date:"15 Jul 2000",slug:"/2000-07-15-house-warming/"}},next:{fields:{title:"Housewarming",date:"17 Jul 2000",slug:"/2000-07-17-housewarming/"}}}}}});
